import React, { useState, useEffect } from "react";
import axios from "axios";

const DisplayData = () => {
  const [landingData, setLandingData] = useState([]);
  const [apacheData, setApacheData] = useState([]);
  const [activeTab, setActiveTab] = useState("landing");

  useEffect(() => {
    const fetchData = async (apiEndpoint) => {
      try {
        const response = await axios.get(
          `http://localhost/backend/process_data.php?api=${apiEndpoint}`
        );
        if (apiEndpoint === "wp_s3cu_form_on_landing") {
          setLandingData(response.data);
        } else {
          setApacheData(response.data);
        }
        console.log(response.data); // Move this line here to see the fetched data
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };
  
    fetchData(activeTab === "landing" ? "wp_s3cu_form_on_landing" : "apache-logs");
  }, [activeTab]);
  

  const switchTab = (tab) => {
    setActiveTab(tab);
  };

  // ...

return (
  <div>
    <div>
      <button onClick={() => switchTab("landing")}>WP_s3cu_form_on_landing</button>
      <button onClick={() => switchTab("apache_logs")}>Apache Logs</button>
    </div>
    <table>
      <thead>
        {activeTab === "landing" ? (
          <tr>
            <th>ID</th>
            <th>Main Point</th>
            <th>Sex</th>
            <th>Age</th>
            <th>Params</th>
            <th>Created At</th>
            <th>Updated At</th>
          </tr>
        ) : (
          <tr>
            <th>ID</th>
            <th>IP</th>
            <th>DateTime</th>
            <th>RequestMethod</th>
            <th>URL</th>
            <th>Protocol</th>
            <th>StatusCode</th>
            <th>ResponseSize</th>
            <th>Referrer</th>
            <th>UserAgent</th>
          </tr>
        )}
      </thead>
      <tbody>
        {activeTab === "landing"
          ? landingData.map((item) => (
              <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.main_point}</td>
                <td>{item.sex}</td>
                <td>{item.age}</td>
                <td>{item.params}</td>
                <td>{item.created_at}</td>
                <td>{item.updated_at}</td>
              </tr>
          ))
          : apacheData.map((item) => (
              <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.ip}</td>
                <td>{item.datetime}</td>
                <td>{item.request_method}</td>
                <td>{item.url}</td>
                <td>{item.protocol}</td>
                <td>{item.status_code}</td>
                <td>{item.response_size}</td>
                <td>{item.referrer}</td>
                <td>{item.user_agent}</td>
              </tr>
          ))}
      </tbody>
    </table>
  </div>
  );

};

export default DisplayData;
